  return (
    <div className="o-col o-col--lg75 t-site-header__menu">
      <div className="c-nav">

          <button  className="c-nav__item" ><NavLink exact to="/">Start</NavLink></button>
          <button className="c-nav__item" >O co chodzi</button>
          <button className="c-nav__item" >O nas</button>
          <button className="c-nav__item" >Fundacje i  organizacje</button>
          <button className="c-nav__item" >Kontakt</button>

      </div>
    </div>
  )
}

export default Menu;
